import React, { Component } from 'react';
import { GiBladeBite } from 'react-icons/gi';

export default class Nav extends Component {
  handleClick = () => {
    // Обработчик клика, который вы можете настроить по вашим требованиям
    console.log('Clicked on Nav');

    // Здесь вы можете выполнять другие операции при клике
  };

  render() {
    return (
      <div id="navv" onClick={this.handleClick} className="nav">
        <GiBladeBite />
      </div>
    );
  }
}
